# Split input into list of words
words = line.split()

# Count number of words with "ae"
num_words_with_ae = 0
for word in words:
    if contains_ae(word):
        num_words_with_ae += 1

# Calculate percentage of words with "ae"
percentage_with_ae = float(num_words_with_ae) / float(len(words))

